クリアコーティング加工で艶のある質感を実現！<br>製品素材は環境に優しいウレタン系合皮を使用！！<br><br><br>伸びるシートで曲面も自由自在！！<br>細部までキレイに張り込める！！<br><br>カーボンの凹凸をリアルに再現しており、高級感を存分に楽しんで頂けます。<br>ウレタン系合皮を使用している為、切り口から毛羽立つ事も無くキレイにカットしていただけます。<br>さらに、柔軟性に優れているため、曲面にも貼る事が出来、細部までキレイに貼って頂く事が可能です。伸びるシートで曲面も自由自在！<br>内装をグレードアップ！<br><br>自動車の内装品や、携帯電話、家庭用小物などに貼ってご使用頂けます。 <br> <br>※屋外での耐候性・防水性には適しておりませんのでエクステリアへのご使用はお控えください。<br><br><br><br>■仕様<br>サイズ：Sサイズ（250mm x 300mm）<br> カラー：ブラック<br> <br>メーカー：ハセ・プロ<br> 品番：LCN-S<style type="text/css">
<!--

/* 注目のキーワード */

div#HeaderKeyword {
